def mergeKLists(ar):
	def remerge(a, b):
		if not a:
			return b
		if not b:
			return a
		result = None
		if a.data < b.data:
			result = a
			result.next = remerge(a.next, b)
		else:
			result = b
			result.next = remerge(a, b.next)
		return result

	def merge(a, b):
		result = None
		cur = None
		while a and b:
			an = a.next
			bn = b.next
			if a.data < b.data:
				if not result:
					result = a
					cur = a
				else:
					cur.next = a
					cur = cur.next
				a = an
			else:
				if not result:
					result = b
					cur = result
				else:
					cur.next = b
					cur = cur.next
				b = bn
		if a:
			cur.next = a
		if b:
			cur.next = b
		return result

	def divide(arr):
		if len(arr) == 1:
			return arr[0]
		start = 0
		end = len(arr) - 1
		mid = (end + start) // 2
		left = divide(arr[start:mid + 1])
		right = divide(arr[mid + 1:end + 1])
		return remerge(left, right)

	return divide(ar)


